import React, { useState } from 'react';
import EditTodo from './EditTodo';

const TodoItem = ({ todo }) => {
  const [isEditing, setIsEditing] = useState(false);

  return (
    <li>
      {isEditing ? (
        <EditTodo todo={todo} />
      ) : (
        <>
          <span>{todo.text}</span>
          <button onClick={() => setIsEditing(true)}>Edit</button>
        </>
      )}
    </li>
  );
};

export default TodoItem;
